import React from 'react'

export const TableRow = ({data}) =>{
    const [state,setState] = React.useState([])

    // console.log(data)

    // for ()
    // console.log('rerending')

    let dataSet = []
    for (let value in data ){
        dataSet.push(value)

    }
    setState(dataSet)


    return(
        <tr className="main__table__row">
            {state.length > 0 ? dataSet.map((item)=>{
                return <td key={item} className="main__table__row__box">
                    <div className="main__table__row__box__single">
                    {item}
                    </div>
                    </td>
            }) : ''} 
        </tr>

    )
}
